import{_ as i,p as a,q as l,Y as e}from"./framework-aa5c4115.js";const h={},r=e('<h2 id="九月份" tabindex="-1"><a class="header-anchor" href="#九月份" aria-hidden="true">#</a> 九月份</h2><h3 id="今天9月1号" tabindex="-1"><a class="header-anchor" href="#今天9月1号" aria-hidden="true">#</a> 今天9月1号</h3><ul><li>九月一号，新的一月开始；</li><li>上月先是有一个原生安卓的开发，需要借助科大讯飞的离线语音识别功能，奈何能力有限，索性就写了几个关于新能源方面的电力监控大屏页面；</li><li>说来也巧了之前做项目为水务的，现在做电力，可笑！什么时候能让我进电力系统呢？</li><li>唯一不同的可能是本次为一个人全程负责一个项目吧，或许吧......</li></ul><h3 id="_9月5号" tabindex="-1"><a class="header-anchor" href="#_9月5号" aria-hidden="true">#</a> 9月5号</h3><ul><li>大屏页面已经写差不多了，后续可能需要统一一下布局以及ui。</li><li>现阶段需要学习拖拽组件，类似低代码开发，大致需求就是为了再有大屏项目的时候能够快速反应而不用再重头再来的去设计。</li><li>可能实现起来有点困难，码路漫漫.....</li></ul><h3 id="_9月6号" tabindex="-1"><a class="header-anchor" href="#_9月6号" aria-hidden="true">#</a> 9月6号</h3><ul><li>在抖音刷到邮寄明信片的，新疆西藏等地方，我在评论区评论了“来个边疆的，或者河南的，给我寄一个”</li><li>过了一会有人回复了，说是刚到新疆 如果有机会邮寄的话一定给我邮寄一个 哈哈哈~</li><li>我想这个博客就用来记录工作和碎碎念吧，慢慢留着看，充实自己的生活，慢慢记录着，留下属于自己的印记。</li></ul><h3 id="_9月14号" tabindex="-1"><a class="header-anchor" href="#_9月14号" aria-hidden="true">#</a> 9月14号</h3><ul><li><p>今天周四了，现在是下午16：15分，忙起来也就忘了记录。</p></li><li><p>这几天一直在忙着写数据大屏编辑器，对java丝毫不懂，强迫自己学了一下数据库，学习了一下若依的前后端分离版。idea好像确实挺好用的，就是我电脑运行起来有点卡。</p></li><li><p>周一卡到一个bug到昨天晚上才解决，项目刚才跑起来还算顺利，得出空来记一下。也没什么，项目跑起来了，前面做的大屏还没有调接口，不知道为什么非要用字符串来进行前后端传数据。</p></li><li><p>前段时间他们好像设计了一些ui图标，真心话，没有开源的好看....</p></li><li><p>周三买了欢乐谷的门票，周六去吧。</p></li><li><p>快国庆了，该回家一趟了，出去玩也是穷游。广西真想去看看。</p></li></ul><h3 id="_9月18号" tabindex="-1"><a class="header-anchor" href="#_9月18号" aria-hidden="true">#</a> 9月18号</h3><ul><li><p>9.18事变，小日本侵略我国东北，勿忘国耻！</p></li><li><p>上周去了上海博物馆，吐槽一下，博物馆本身就不大，工作人员却不少，很多展厅还关门了，没劲。</p></li><li><p>周日和朋友去了欢乐谷，玩了“天地双雄”，3.多秒升高到59米貌似，屁股不在椅子上，呼吸不上来，大脑一片空白，全程卧槽。看了鬼屋，烟花秀，百乐门上海滩小剧场（很不错），想去漂流的排队一个小时就放弃了，真的年龄大刺激的不敢玩。如果玩尽兴的话还是要早上去。</p></li><li><p>项目进度：数据大屏完成，告一段落。 数据大屏可视化编辑放到后面。下午开会，节前研究老项目，用vue重构，接下来节后也是这个项目了，我很喜欢。</p></li><li><p>28号晚上下班直奔南京路，东方明珠。国庆节29号回家。</p></li></ul><h3 id="_9月19号" tabindex="-1"><a class="header-anchor" href="#_9月19号" aria-hidden="true">#</a> 9月19号</h3><ul><li>上午接口用postman测了一下，测通了。</li><li>我就说是jquery的项目，还说不是，代码那么乱，都$.ajax了还狡辩。什么文档都没有，玩的就是真实。</li></ul><h3 id="_9月20-25号" tabindex="-1"><a class="header-anchor" href="#_9月20-25号" aria-hidden="true">#</a> 9月20-25号</h3><ul><li>这几天一直研究发请求的参数，全项目为字符串传参，单页面发请求是可以的，封装api会出问题，最后用npm的qs包解决。</li></ul><h3 id="_9月28" tabindex="-1"><a class="header-anchor" href="#_9月28" aria-hidden="true">#</a> 9月28</h3><ul><li>今天放假，国庆把花裤衩的后台改为了没有权限也能渲染侧边栏的demo。小破站和官方文档还是最好的老师。</li></ul>',17),d=[r];function n(t,u){return a(),l("div",null,d)}const s=i(h,[["render",n],["__file","23-09.html.vue"]]);export{s as default};
